        "def naiveBayesClassifier(xtr, xte, ytr, yte, folds):\n",
        "    print(\"\\nNaiveBayes Classifier\")\n",
        "    \n",
        "    clf = GaussianNB()\n",
        "    pipe = make_pipeline(preprocessing.StandardScaler(), clf)\n",
        "    print(f'number of diabetes samples in the training data : {ytr[ytr == 1].shape[0]}')\n",
        "    print(f'number of normal samples in the training data : {ytr[ytr == 0].shape[0]}')\n",
        "\n",
        "    skf = StratifiedKFold(folds)\n",
        "    n_iter_search = 25\n",
        "    # Hyper parameters\n",
        "    var_smoothing = np.logspace(0,-9, num=100)\n",
        "    \n",
        "    parameter_dict = dict(gaussiannb__var_smoothing=var_smoothing)\n",
        "    \n",
        "    rs_NB = RandomizedSearchCV(pipe, param_distributions=parameter_dict, n_iter=n_iter_search, cv=skf, verbose=1, scoring='roc_auc')\n",
        "    \n",
        "    xtr_transformed = PowerTransformer().fit_transform(xtr)\n",
        "    rs_NB.fit(xtr_transformed, ytr)\n",
        "    tuned_params = rs_NB.best_params_\n",
        "\n",
        "    # Tuned Hyper parameters\n",
        "    print(tuned_params)\n",
        "    var_smoothing = tuned_params['gaussiannb__var_smoothing']\n",
        "\n",
        "    tuned_clf = GaussianNB(var_smoothing=var_smoothing)\n",
        "    modelEvaluator(tuned_clf, xte, yte, 4)\n",
        "\n",
        "\n",
        "def XGBoostClassifier(xtr, xte, ytr, yte, folds):\n",
        "    print(\"\\nXGBoost Classifier -Best Tuned Model\")\n",
        "\n",
        "    clf = XGBClassifier()\n",
        "    pipe = make_pipeline(preprocessing.StandardScaler(), clf)\n",
        "    print(f'number of diabetes samples in the training data : {ytr[ytr == 1].shape[0]}')\n",
        "    print(f'number of normal samples in the training data : {ytr[ytr == 0].shape[0]}')\n",
        "    skf = StratifiedKFold(folds)\n",
        "    n_iter_search = 25\n",
        "    # Hyper parameters\n",
        "    params = {\n",
        "      \"learning_rate\" : [0.05,0.10,0.20],\n",
        "      \"max_depth\" : [3, 6, 9],\n",
        "      \"min_child_weight\" : [1, 10, 100],\n",
        "    }\n",
        "    # n_estimators = [20, 40, 60, 80, 100]\n",
        "    # learning_rate = [0.0001, 0.001, 0.01, 0.1, 1.0]\n",
        "    # algorithm = ['SAMME', 'SAMME.R']\n",
        "\n",
        "    param_dist = dict(xgbclassifier__min_child_weight=params['min_child_weight'],\n",
        "                      xgbclassifier__learning_rate=params['learning_rate'], xgbclassifier__max_depth = params['max_depth'])\n",
        "\n",
        "    random_search = RandomizedSearchCV(pipe, param_distributions=param_dist, n_iter=n_iter_search, cv=skf,\n",
        "                                       scoring='roc_auc', verbose=1)\n",
        "    random_search.fit(xtr, ytr)\n",
        "    tuned_params = random_search.best_params_\n",
        "    print(tuned_params)\n",
        "    tuned_clf = random_search.best_estimator_\n",
        "\n",
        "    print(tuned_clf)\n",
        "    # Tuned Hyper parameters\n",
        "    min_child_weight = tuned_params['xgbclassifier__min_child_weight']\n",
        "    max_depth = tuned_params['xgbclassifier__max_depth']\n",
        "    learning_rate = tuned_params['xgbclassifier__learning_rate']\n",
        "    \n",
        "    # n_estimators = tuned_params['xgbregressor__n_estimators']\n",
        "    # learning_rate = tuned_params['xgbregressor__learning_rate']\n",
        "    # algorithm = tuned_params['xgbregressor__algorithm']\n",
        "\n",
        "    # print('\\nAB Best Tuned Model')\n",
        "    tuned_clf = XGBClassifier(min_child_weight=min_child_weight, learning_rate=learning_rate, max_depth=max_depth)\n",
        "    modelEvaluator(tuned_clf, xte, yte, 4)\n",
        "\n",
        "\n",
        "def logisicRegression(xtr, xte, ytr, yte, folds):\n",
        "    n_iter_search = 25\n",
        "    skf = StratifiedKFold(folds)\n",
        "    \n",
        "    clf = LogisticRegression(random_state=7)\n",
        "    pipe = make_pipeline(preprocessing.StandardScaler(), clf)\n",
        "\n",
        "    print(f'number of diabetes samples in the training data : {ytr[ytr == 1].shape[0]}')\n",
        "    print(f'number of normal samples in the training data : {ytr[ytr == 0].shape[0]}')\n",
        "\n",
        "    # Hyper parameters\n",
        "    C_range = sp_rand()\n",
        "    penalty_options = ['l1', 'l2']\n",
        "    solver = ['liblinear', 'saga']\n",
        "    max_iter = [300, 600, 900]\n",
